import React, { useState } from 'react'
import './App.css';

const api = {
  // base: 'https://cors-anywhere.herokuapp.com/https://api.smarkets.com/v3/events/'
  base: 'https://api.smarkets.com/v3/events/'
}

const App = () => {
  const [eventData, setEventData] = useState('')

  fetch(`${api.base}`)
    .then(res => res.json())
    .then(result => {
      setEventData(result)
      console.log(result)
    })
  return (
    <div className="App">
    </div>
  );
}

export default App;
